import { ICancelScheduledValuesAutomationEvent } from 'automation-events/src/interfaces/index';
import { TAutomationEvent } from 'automation-events/src/types/index';

export const isCancelScheduledValuesAutomationEvent = (
    automationEvent: TAutomationEvent
): automationEvent is ICancelScheduledValuesAutomationEvent => {
    return automationEvent.type === 'cancelScheduledValues';
};
